import React from 'react';
import Slider from 'react-slick';
import styled from 'styled-components';

function Roadmap() {
    var settings = {
            arrow: true,
            infinite: false,
            speed: 400,
            slidesToShow: 4,
            slidesToScroll: 1
        };

    return (
        <RoadmapSection>
            <RoadmapContainer>
                <div>
                    <h2>Adaptive height</h2>
                    <Slider {...settings}>
                        <div>
                            <RoadmapItemHolder className="roadmap-bottom">
                                <RoadmapLiner>
                                    <Line/>
                                    <Dot/>
                                    <Line/>
                                </RoadmapLiner>
                                <RoadmapContent>
                                    <RoadmapDate>Q2 2017</RoadmapDate>
                                    <Content>Aliquam lorem ante, dapi bus in, viverra quis, feugi at a, tel lus. Phaselus vive</Content>
                                </RoadmapContent>
                            </RoadmapItemHolder>
                        </div>
                        <div>
                            <RoadmapItemHolder className="roadmap-top">

                            </RoadmapItemHolder>
                        </div>
                        <div>
                            <h3>3</h3>
                        </div>
                        <div>
                            <h3>4</h3>
                        </div>
                        <div>
                            <h3>5</h3>
                        </div>
                        <div>
                            <h3>6</h3>
                        </div>
                    </Slider>
                </div>
            </RoadmapContainer>

        </RoadmapSection>
    );
}

const RoadmapSection = styled.section`
    color: #fff;

    padding: 0 10%;

    min-height: 550px;

    .slick-list{
        overflow: visible !important;
    }
`

const RoadmapContainer = styled.div`
`

const RoadmapItemHolder = styled.div`
    position: relative;
`

const RoadmapLiner = styled.div`
    display: flex;
    flex-direction: row;
    overflow: visible;
    height: 20px;
    align-items: center;
    justify-content: center;
`

const Line = styled.div`
    width: 50%;
    background: #aceb2f;
    height: 3px;
`

const Dot = styled.div`
    width: 20px;
    height: 20px;
    background: #fff;
    border: 5px solid #aceb2f;
    border-radius: 5rem;
`

const RoadmapContent = styled.div`
    position: absolute;
    top: 75px;
`

const RoadmapDate = styled.div``

const Content = styled.div``

export default Roadmap;
